    ('12', '2015-11-27 15:00:20', '2015-11-27 15:00:20', '0', '10917', '青汁', '青汁是以大麦嫩叶、甘薯嫩叶、甘蓝嫩叶以及青桔等天然绿色植物所榨成的汁或以此加工的超微粉末所冲调的饮品。', '2', '/2/12/', '2', '1'),
