    INSERT INTO `brand` VALUES
    ('2', '2015-10-23 18:02:22', '2015-10-23 18:02:22', '0', '3', 'Seagate', ' 希捷（Seagate Technology Cor）成立于1979年，目前是全球最大的硬盘、磁盘和读写磁头制造商，总部位于美国加州司各特谷市。希捷在设计、制造和销售硬盘领域居全球领先地位，提供用于企业、台式电脑、移动设备和消费电子的产品。', '1', '0'),
    ('3', '2015-10-23 18:04:09', '2015-10-23 18:04:09', '0', '4', '美孚', ' 埃克森美孚公司是世界领先的石油和石化公司，由约翰·洛克菲勒于1882年创建，总部设在美国得克萨斯州爱文市。', '2', '0'),
    ('4', '2015-11-13 16:58:31', '2015-11-13 16:58:31', '0', '6', '花王/Merries', '花王纸尿裤是来自日本的王牌纸尿裤，花王纸尿裤的综合性能很好，无论是柔软性、干爽性、包裹感、立体舒适感等各方面都颇有口碑。', '1', '0'),
    ('5', '2015-11-16 11:09:40', '2015-11-16 11:09:40', '0', '8', 'Aptamil爱他美', ' 爱他美奶粉产自德国，曾是德国美乐宝（Milupa）集团旗下品牌。建立于1921年的美乐宝集团，凭借遗传医学的独特技术，于1968年研发出爱他美奶粉。', '2', '0'),
    ('6', '2015-11-16 11:51:42', '2015-11-16 11:51:42', '0', '8', 'Arla爱氏晨曦', ' ARLA爱氏晨曦有机奶自创立到2013年已经有130多年的历史，丹麦ARLA乳品公司是丹麦MD Foods 和瑞典ARLA 两家乳品合作社企业于2000年4月17日正式合并而成。', '3', '0'),
    ('7', '2015-11-26 14:59:52', '2015-11-26 14:59:52', '0', '9', 'Metabolic en Natural', ' 日本目前最新上市也是最火爆的一款减肥清肠排毒酵素，国内外杂志争相介绍，由日本人气模特美香代言的产品。由日本国内生产的18种天然蔬果+100种以上蔬果酵素+20亿乳酸菌配合，自然派减肥清肠产品。含有大量的植物酵素，以及益生菌乳酸菌，每天只需冲饮15秒即可饮用，一天一杯，健康美丽！', '1', '0'),
    ('8', '2015-11-26 15:02:29', '2015-11-26 15:02:29', '0', '9', '大高酵素', ' 大高酵素[1]  是一种源自天然果蔬自然发酵而成的植物精华原液，是一款激发生命脉动力量，维持生命活力的高端饮品，蕴含自然平衡的丰富微量元素，是调节体内微生物平衡、完全消化吸收的干净食品。\n大高酵素品牌由北海道大高·登先生于1926年创立，并成立了日本大高酵素株式会社，持有大高酵素的全部工艺技术专利，经过88年的漫长发展，大高酵素品牌经久不衰，近百年的岁月磨砺使其愈发的焕发魅力，并成为世界上发源最正宗、历史最悠久的国际酵素品牌。', '2', '0'),
    ('10', '2015-11-26 15:06:35', '2015-11-26 15:06:35', '0', '9', 'metabolic酵素x酵母', ' metabolic酵母X酵素内含108种野草与活性型酵素，配合韩国高丽大学研究开发的特殊酵母，使人体每天补充丰富健康的的酵素与酵母。', '3', '0'),
    ('11', '2015-11-26 15:17:11', '2015-11-26 15:17:11', '0', '10', '花王眼罩', ' 花王眼罩是MM们去日本旅行时必买单品之一。特别适合学习压力很大的学生以及办公室里的OL们，还有长途出差或者旅行时的交通工具里。\n既能舒缓疲劳又有去黑眼圈保护视力的神奇功效，而且还有助于失眠的改善。', '2', '0'),
    ('12', '2015-11-27 14:58:14', '2015-11-27 14:58:14', '0', '9', 'YUKI活酵素', ' ', '4', '0'),
    ('13', '2015-11-27 15:03:10', '2015-11-27 15:03:10', '0', '12', 'ASAHI', ' 采用日本大分县生产的绝对无农药、无化学肥料添加放心原材料\n营养均衡的21种蔬菜水果，严格的栽培品质管理体系，所有材料均未使用农药及化学肥料栽培。\n高科技的微粉碎、干燥（真空冻结干燥法）技术，与其他干燥法相比，几乎不用加热，保持食物本身的营养价值，增加口感的同时利于吸收。', '1', '0'),
    ('14', '2015-11-27 15:04:16', '2015-11-27 15:04:16', '0', '12', '大麦若叶青汁', ' 大麦若叶美味青汁100%', '2', '0'),
    ('15', '2015-11-27 15:08:43', '2015-11-27 15:08:43', '0', '13', 'DHC 蝶翠诗', ' 1972年，DHC由现任总裁吉田嘉明独自创业。经过30多年努力，现已成为跨化妆品、医药保健食品、医药品、翻译出版、高级美容院、水疗等多个领域的综合性企业，并取得了引人注目的辉煌业绩。 ', '1', '0'),
    ('16', '2015-12-09 10:46:44', '2015-12-09 10:46:44', '0', '7', 'Seagate', ' 希捷公司是第一家将使您拥有数字生活（不论从家庭、手持设备、汽车，还是办公室）的技术带入市场的公司，如垂直记录、基于硬件的全磁盘加密技术和混合硬盘等，并不断投资于新技术的开发以提高性能、速度和面密度（在更小空间内存储更多数据的能力）。', '1', '0'),
    ('17', '2015-12-09 14:08:14', '2015-12-09 14:08:14', '0', '14', 'Seagate', ' 希捷（Seagate Technology Cor）成立于1979年，目前是全球最大的硬盘、磁盘和读写磁头制造商，总部位于美国加州司各特谷市。希捷在设计、制造和销售硬盘领域居全球领先地位，提供用于企业、台式电脑、移动设备和消费电子的产品。', '2', '0'),
    ('18', '2015-12-22 10:34:32', '2015-12-22 10:34:32', '0', '11', '东芝', ' 东芝（Toshiba），是日本最大的半导体制造商，也是第二大综合电机制造商，隶属于三井集团。公司创立于1875年7月，原名东京芝浦电气株式会社，1939年由东京电气株式会社和芝浦制作所合并而成，业务领域包括数码产品、电子元器件、社会基础设备、家电等。20世纪80年代以来，东芝从一个以家用电器、重型电机为主体的企业，转变为包括通讯、电子在内的综合电子电器企业。进入90年代，东芝在数字技术、移动通信技术和网络技术等领域取得了飞速发展，成功从家电行业的巨人转变为IT行业的先锋。 ', '2', '0'),
    ('19', '2015-12-22 10:39:59', '2015-12-22 10:39:59', '0', '14', '东芝', ' 东芝（Toshiba），是日本最大的半导体制造商，也是第二大综合电机制造商，隶属于三井集团。公司创立于1875年7月，原名东京芝浦电气株式会社，1939年由东京电气株式会社和芝浦制作所合并而成，业务领域包括数码产品、电子元器件、社会基础设备、家电等。20世纪80年代以来，东芝从一个以家用电器、重型电机为主体的企业，转变为包括通讯、电子在内的综合电子电器企业。进入90年代，东芝在数字技术、移动通信技术和网络技术等领域取得了飞速发展，成功从家电行业的巨人转变为IT行业的先锋。', '3', '0'),
    ('20', '2016-01-18 17:33:26', '2016-01-18 17:33:26', '0', '11', 'Seagate', '   ', '10', '0'),
    ('21', '2016-02-17 12:21:06', '2016-02-17 12:21:06', '0', '16', 'KSONE', ' 巴基斯坦 草地曲棍球用品  ', '1', '0'),
    ('22', '2016-02-17 16:24:29', '2016-02-17 16:24:29', '0', '17', 'KSONE', '巴基斯坦  KSONE 原装进口草地曲棍球护腿板', '1', '0'),
    ('23', '2016-02-17 17:06:19', '2016-02-17 17:06:19', '0', '18', 'KSONE', ' 巴基斯坦原装进口 KSONE 原装进口草地曲棍球手套 ', '1', '0'),
    ('26', '2016-02-22 09:53:26', '2016-02-22 09:53:26', '0', '7', '西部数据', ' 西部数据公司（Western Digital Corp）是全球知名的硬盘厂商，成立于1970年，目前总部位于美国加州，在世界各地设有分公司或办事处，为全球五大洲用户提供存储器产品。长期以来，西部数据一直致力于为全球个人电脑用户提供完善的存储解决方案，而作为全球存储器业内的先驱及长期领导者，西数在为用户及收集、管理与使用数字信息的组织方面具有丰富的服务经验，同时也具有良好的口碑，特别是在欧美市场。', '1', '0'),
    ('27', '2016-03-04 13:47:07', '2016-03-04 13:47:07', '0', '20', '爱他美', ' 爱他美', '1', '0'),
    ('28', '2016-03-10 15:13:19', '2016-03-10 15:13:19', '0', '21', 'Swisse', ' wisse品牌于50年代后期成立于澳大利亚的墨尔本，是澳洲自然医学疗法的先驱之一，所有临床研究均在澳洲知名高等学府进行。其采用最科学的配方与最优质的原材料，所有产品均经过临床认证，安全有效。', '1', '0'),
    ('29', '2016-03-10 15:15:15', '2016-03-10 15:15:15', '0', '21', 'Blackmores', 'Blackmores，又名澳佳宝。是澳大利亚的第一品牌保健品。提供一系列高品质的维生素、矿物质、草药以及营养补充品。澳佳宝成立于1930年，已经有近80年历史。经过80年努力，它已经成长为澳洲本土及全世界最被信任的生活科技健康食品公司。在1985年5月正式成为上市公司。目前拥有超过400名员工 ，总部设在澳大利亚悉尼。', '2', '0'),
    ('30', '2016-03-10 15:19:49', '2016-03-10 15:19:49', '0', '20', '贝拉米', ' 贝拉米有机食品是一家澳洲独资公司，所有产品均为澳洲制造，且获得100%有机食品双重认证。', '3', '0'),
    ('31', '2016-03-10 15:21:38', '2016-03-10 15:21:38', '0', '20', 'A2', ' A2有限公司 (简称“A2C”)是一家迅速成长的乳制品公司， 旗下a2®牛奶及相关产品建立在独一无二的知识产权研发及专利技术上， 目前足迹遍及新西兰、澳大利亚、英国及中国。', '4', '0'),
    ('32', '2016-03-11 17:46:40', '2016-03-11 17:46:40', '0', '21', 'Devondale/德运', ' Devondale/德运Devondale/德运Devondale/德运Devondale/德运Devondale/德运 ', '4', '0'),
    ('33', '2016-03-14 10:05:53', '2016-03-14 10:05:53', '0', '21', 'Maxigenes', ' Maxigenes美可卓是产自全球公认优质奶源基地的新西兰，是新澳本土产奶粉之中，唯一添加母乳成分β-胡萝卜素配方奶粉，更贴近母乳成分。采用国际领先的配方及工艺，生产流程严格执行国际高标准质量监控，让宝宝放心享受更安全，更优质，更贴近母乳的营养生活。', '2', '0'),
    ('34', '2016-03-14 15:41:55', '2016-03-14 15:41:55', '0', '23', 'Blackmores', ' BlackmoresBlackmoresBlackmoresBlackmoresBlackmores', '1', '0'),
