#订单增加 分销商ID、供应商ID
ALTER TABLE `orders`
	ADD COLUMN `drp_usere_id` int  COMMENT '分销商ID' AFTER `user_id`,
	ADD COLUMN `supply_user_id` integer COMMENT '供应商ID' AFTER `user_id`;

#支付增加 分销商ID、供应商ID
ALTER TABLE `pay_orders`
	ADD COLUMN `drp_usere_id` int  COMMENT '分销商ID' AFTER `order_id`,
	ADD COLUMN `supply_user_id` integer COMMENT '供应商ID' AFTER `order_id`;

#退款订单 分销商ID、供应商ID
ALTER TABLE `refund_orders`
	ADD COLUMN `drp_usere_id` int  COMMENT '分销商ID' AFTER `order_id`,
	ADD COLUMN `supply_user_id` integer COMMENT '供应商ID' AFTER `order_id`;


